import React from 'react';
import Latest from './Latest';

class MainSubsections extends React.Component{
    
    render(){
        return(
            <React.Fragment>
                <Latest latestArr={this.props.LatestList}></Latest>
            </React.Fragment>
        )
    }
}
export default MainSubsections;
